import React from 'react'

function ExtractCsvTable(items) {
    console.log(items.tableData)
    let data = items.tableData ? items.tableData: [];
    let column;
    if(data.length > 0){
        column = Object.keys(data[0])
    }

    return (
        <>
          <table>
              <thead>
                {column.map((item)=>{
                    return(
                        <th>{item}</th>
                    )
                })}
              </thead>
              <tbody>

         {data.map((item)=>{
              return ( 
                <tr>
                <td>{item.username}</td>
                </tr>
              )
            })}

            </tbody>
            </table>
        </>
    )
}

export default ExtractCsvTable
